import React from 'react';
import { Col, Container, Row } from 'react-bootstrap';

const Footer = () => {
    return (
        <div>
            <Container>
                <Row className='g-5'>
                    <Col lg={4} md={6} sm={12}>
                        <h3>About Me</h3>
                        <p>My name is Burhan Uddin. I'm 21.</p>
                    </Col>
                    <Col lg={4} md={6} sm={12}>
                        <h3>Contact Me</h3>
                        <p>Email: </p>
                        <p>Phone: </p>

                    </Col>
                    <Col lg={4} md={6} sm={12}>
                        <h3>Follow Me</h3>
                        <p>Facebook: </p>
                        <p>Twitter: </p>
                        <p>Instagram: </p>

                    </Col>
                </Row>
            </Container>
        </div>
    );
};

export default Footer;
